Tug is a one man band adn has many years of activity in the Greek diy scene. He is playing a mix of punk rock and more alternative styles, he ussually plays with Greek lyrics but sometimes he also sings english. Here you can find an unbelievable cover of Tom Wait&amp;#039;s Lullaby song but in a punk way!
He has released many demos through the years and made concerts all over Greece. This release is a cd he made back in 2003.
